import Watermelon from './../../img/watermelon.png'

function CardHome({title}){
    return (
        <>
            <article class="cardHome">
                <p className="cardTitle">{title}</p>
                <img className="cardImg" src={Watermelon} alt="watermelon dog"></img>
            </article>
        </>
    )
}

export default CardHome;
